import React from 'react'
import "./Nav-panel.css" 
import {Link} from "react-router-dom"


const Navbar = () =>  {
    return (
        <nav class="navbar navbar-light bg-dark">
          <Link class="navbar-brand" to="/">
            Bootstrap
          </Link>

        </nav>
    )
}

export default Navbar
